@Test
    public void testPutValue()
    {
        SetMap<String, Integer> map = new SetMap<>();

        map.putValue( "a", 1 );
        map.putValue( "a", 2 );
        map.putValue( "a", 3 );
        map.putValue( "b", 4 );
        map.putValue( "b", 5 );
        map.putValue( "c", 6 );

        assertEquals( Sets.newHashSet( 1, 2, 3 ), map.get( "a" ) );
        assertEquals( Sets.newHashSet( 4, 5 ), map.get( "b" ) );
        assertEquals( Sets.newHashSet( 6 ), map.get( "c" ) );        
    }

